def solution(nums, target):
    dic = {}
    for i, num in enumerate(nums):
        need = target - num
        if need in dic:
            return [dic[need], i]
        dic[num] = i

def longestCommonPrefix(strs) -> str:
    if not strs[0]:
        return ""
    prefix, res, index, length = "", "", 0, len(strs)
    while index < length + 2:
        for l in strs:
            try:
                prefix += l[index]
            except Exception:
                return res
        if prefix != prefix[0]*length and index == 0:
            return ""
        elif prefix != prefix[0]*length and index != 0:
            break
        else:
            res += prefix[0]
            index += 1
        prefix = ""
    return res
